import "../styles/Home.css";
import React from "react";
import loginImage from "../assets/login-photo.jpg";
import MyButton from "../components/MyButton";

const Homepage = (props) => {
  return (
    <div>
      <div className="Hero">
        <div className="Hero-text-part">
          <h1>Un espace communautaire pensé pour vous</h1>
          <p>
            Vous l'attendiez, nous l'avons fait ! Groupoconnect est une
            plateforme communautaire ayant pour objectif de vous permettre
            d'échanger avec vos collègues. Envie de boire un verre après une
            longue semaine, de trouver des copilotes de sports, des gourmands
            pour le gouter... ? Laissez parlez vos envies !{" "}
          </p>
          <MyButton icon="" title="Partager avec la communauté">
            <i class="fa-solid fa-plus"></i>
          </MyButton>
        </div>
        <div className="image-section">
          <img />
        </div>
      </div>
      <div className="social-wall">
        <div className="title-part">
          <h2 className="title-part-title">La galerie</h2>
          <p className="title-part-description">
            Un espace pour apprendre à connaitre ses colègues. Vous êtes libre
            de commenter celles qui vous intéressent et d’enregistrer celles que
            vous préférez.
          </p>
        </div>
      </div>
    </div>
  );
};

export default Homepage;
